import React from "react";
import { useNavigate } from "react-router-dom";
import { FaPlusCircle, FaClipboardList, FaCalendarAlt } from "react-icons/fa";
import "./DaycarePanel.css";

const DaycarePanel = () => {
  const navigate = useNavigate();

  const handleCreateDaycareProfileClick = () => {
    navigate("/daycareRegiForm");
  };

  const handleManageBookingsClick = () => {
    navigate("/findDaycareBooking");
  };

  const handleViewScheduleClick = () => {
    navigate("/viewDaycareSchedule");
  };

  return (
    <div className="daycarePanel-section">
      <h1 className="daycarePanel-title">Daycare Management Panel</h1>
      <p className="daycarePanel-description">
        Efficiently manage daycare profiles, bookings, and schedules.
      </p>
      <div className="daycarePanel-content">
        <div className="daycarePanel-card" onClick={handleCreateDaycareProfileClick}>
          <FaPlusCircle className="daycarePanel-icon" />
          <h2>Create Daycare Profile</h2>
          <p>Register and manage your daycare profile easily.</p>
        </div>

        <div className="daycarePanel-card" onClick={handleManageBookingsClick}>
          <FaClipboardList className="daycarePanel-icon" />
          <h2>View Bookings</h2>
          <p>Monitor and manage daycare bookings efficiently.</p>
        </div>

        <div className="daycarePanel-card" onClick={handleViewScheduleClick}>
          <FaCalendarAlt className="daycarePanel-icon" />
          <h2>View Schedule</h2>
          <p>Check daycare schedules and plan accordingly.</p>
        </div>
      </div>
    </div>
  );
};

export default DaycarePanel;
